    const handleSubmit = (event) => {
        event.preventDefault()
        onSubmit('cats')
    }
    return (
        <div>
            <form onSubmit={handleSubmit}>
                <input />
                <button onClick={handleSubmit}>Search</button>
            </form>
        </div>
    )
}
export default Searchbar;
